import React, { Component } from 'react';
    import './App.css';
    import Header from './components/Header';
    import Post from './components/Post';

    class App extends Component {
      render() {
        return <div className="App">
            <Header />
            <section className="App-main">
              <Post nickname="Chris" avatar="1.jpg" caption="Moving the community!" image="https://pbs.twimg.com/media/DOXI0IEXkAAkokm.jpg" />
              <Post nickname="OG" avatar="2.jpg" caption="Holding a mic" image="https://pbs.twimg.com/media/DOXI0IEXkAAkokm.jpg" />

              {/* more posts */}
            </section>
          </div>;
      }
    }

    export default App;
